style5.innerText:
body {
            background-color: black;
            color: white;
            font-family: Arial, sans-serif;
            margin: 0;
            padding: 0;
        }
        .top-bar {
            display: flex;
            justify-content: space-between;
            align-items: center;
            padding: 10px 20px;
            background-color: #333;
            color: white;
        }
        .logo {
            font-size: 1.2em;
        }
        .search-icon, .menu-icon {
            cursor: pointer;
            color: white;
        }
        .header-image {
            text-align: center;
            margin-top: 20px;
        }
        .header-image img {
            max-width: 100%;
            height: auto;
        }
        .intro-text {
            text-align: center;
            margin: 20px auto;
            max-width: 80%;
            line-height: 1.6;
        }
        .intro-text p:first-letter {
            font-size: 150%;
        }
        .explore-button {
            display: inline-block;
            background-color: #4CAF50;
            color: white;
            text-align: center;
            padding: 10px 20px;
            text-decoration: none;
            border-radius: 5px;
            margin-top: 20px;
        }
        .explore-button i {
            margin-left: 5px;
        }
        hr {
            border-color: #666;
            margin: 40px auto;
            max-width: 80%;
        }
        .notices {
            text-align: center;
        }
        .notices h4 {
            font-size: 1.5em;
        }
        .notices ul {
            list-style: none;
            padding: 0;
        }
        .notices li {
            background-color: #222;
            color: white;
            border: 1px solid #444;
            padding: 10px;
            margin: 10px;
        }
